import React from "react";
import './Input.css'

function Input({checked, handleChange, disabled}) {



  return (
    <>
      <input type="radio" onChange={handleChange} checked={checked} className="radio" />
      <input type="text" disabled={disabled} className="text" />
    </>
  );
}

export default Input;
